import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FileText, UserPlus, ArrowLeft, Stethoscope, Heart } from 'lucide-react';

export default function DoctorDashboard() {
  const navigate = useNavigate();

  const options = [
    {
      title: "Register Patient",
      description: "Register a new patient to the system",
      icon: UserPlus,
      path: "/patient-registration"
    },
    {
      title: "Create Prescription",
      description: "Create digital prescription with QR code",
      icon: FileText,
      path: "/create-prescription"
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-50 via-indigo-50 to-slate-100">
      {/* Header */}
      <header className="bg-white border-b border-slate-200 shadow-sm sticky top-0 z-50">
        <div className="container mx-auto px-6 py-4">
          <div className="flex items-center gap-3">
            <div className="bg-blue-600 p-2.5 rounded-lg shadow-md">
              <Heart className="w-7 h-7 text-white" fill="white" strokeWidth={2} />
            </div>
            <div>
              <h1 className="text-2xl font-bold text-slate-800">LifeTag</h1>
              <p className="text-xs text-slate-500 font-medium">Medical Management System</p>
            </div>
          </div>
        </div>
      </header>

      <div className="container mx-auto px-6 py-8">
        {/* Back Button */}
        <button
          onClick={() => navigate('/')}
          className="flex items-center gap-2 text-slate-600 hover:text-slate-800 transition-colors mb-6 group"
        >
          <ArrowLeft className="w-5 h-5 group-hover:-translate-x-1 transition-transform" />
          <span className="font-medium">Back to Home</span>
        </button>

        {/* Page Title */}
        <div className="flex items-center gap-4 mb-12">
          <div className="bg-indigo-50 border border-indigo-200 p-3 rounded-xl">
            <Stethoscope className="w-8 h-8 text-indigo-600" strokeWidth={2} />
          </div>
          <div>
            <h2 className="text-3xl font-bold text-slate-800">Doctor Dashboard</h2>
            <p className="text-slate-600 mt-1">Manage patients and create prescriptions</p>
          </div>
        </div>

        {/* Options */}
        <div className="grid md:grid-cols-2 gap-8 max-w-4xl mx-auto">
          {options.map((option, idx) => {
            const Icon = option.icon;
            return (
              <div
                key={idx}
                onClick={() => navigate(option.path)}
                className="group cursor-pointer"
              >
                <div className="bg-white border border-slate-200 rounded-2xl p-8 h-full shadow-md hover:shadow-xl transition-all duration-300 group-hover:-translate-y-2">
                  <div className="bg-indigo-50 border border-indigo-100 w-16 h-16 rounded-xl flex items-center justify-center mb-6 group-hover:scale-110 transition-transform duration-300">
                    <Icon className="w-8 h-8 text-indigo-600" strokeWidth={2} />
                  </div>
                  
                  <h3 className="text-2xl font-bold mb-3 text-slate-800">{option.title}</h3>
                  <p className="text-slate-600 leading-relaxed mb-6">{option.description}</p>
                  
                  <div className="flex items-center text-indigo-600 group-hover:text-indigo-700 font-semibold">
                    <span>Access Module</span>
                    <svg className="w-5 h-5 ml-2 transform group-hover:translate-x-2 transition-transform" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
                    </svg>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}
